 MA terms might better capture the autocorrelation in the data and explain the residuals more comprehensively. For the seasonal model, ARIMA(2,1,0)[12] is chosen as it can sufficiently explain the seasonal autocorrelation observed every 12 lags and capture the annual cycles. These models collectively help in better modeling the different autocorrelation structures observed in the data.  "]},{"cell_type":"markdown","id":"a0f0737e","metadata":{"papermill":{"duration":0.024546,"end_time":"2024-06-23T21:34:05.29316","exception":false,"start_time":"2024-06-23T21:34:05.268614","status":"completed"},"tags":[]},"source":["## COMPARISON OF ARIMA MODELS"]},{"cell_type":"code","execution_count":20,"id":"09241d5b","metadata":{"execution":{"iopub.execute_input":"2024-06-23T21:34:05.345293Z","iopub.status.busy":"2024-06-23T21:34:05.343837Z","iopub.status.idle":"2024-06-23T21:34:05.57116Z","shell.execute_reply":"2024-06-23T21:34:05.567631Z"},"papermill":{"duration":0.257854,"end_time":"2024-06-23T21:34:05.575468","exception":false,"start_time":"2024-06-23T21:34:05.317614","status":"completed"},"tags":[],"vscode":{"languageId":"r"}},"outputs":[{"data":{"text/plain":["\n","Call:\n","arima(x = ts_df, order = c(2, 1, 0), seasonal = list(order = c(2, 1, 0), period = 12))\n","\n","Coefficients:\n","          ar1      ar2     sar1     sar2\n","      -0.8886  -0.4564  -0.6255  -0.3702\n","s.e.   0.0882   0.0886   0.1071   0.1098\n","\n","sigma^2 estimated as 1199163:  log likelihood = -912.74,  aic = 1835.47"]},"metadata":{},"output_type":"display_data"},{"data":{"text/plain":["\n","z test of coefficients:\n","\n","      Estimate Std. Error  z value  Pr(>|z|)    \n","ar1  -0.888600   0.088228 -10.0717 < 2.2e-16 ***\n","ar2  -0.456390   0.088562  -5.1533 2.559e-07 ***\n","sar1 -0.625544   0.107068  -5.8425 5.142e-09 ***\n","sar2 -0.370170   0.109776  -3.3720 0.0007462 ***\n","---\n","Signif. codes:  0 *** 0.001 ** 0.01 * 0.05 . 0.1   1\n"]},"metadata":{},"output_type":"display_data"}],"sou