ill":{"duration":0.02887,"end_time":"2024-06-23T21:34:08.099388","exception":false,"start_time":"2024-06-23T21:34:08.070518","status":"completed"},"tags":[]},"source":["| Model               | All Parameters Significant? | Significant Autocorrelation in Residuals? | Residuals Normally Distributed? | P Values Above Threshold? | Log Likelihood Values | AIC Values              |\n","|---------------------|-----------------------------|--------------------------------------------|----------------------------------|----------------------------|-----------------------|-------------------------|\n","| ARIMA(2,1,0)(1,0,1) | YES                        | NO                                       | YES                            | YES                       | -1005.82              | 2021.65                 |\n","| ARIMA(2,1,0)(2,1,0) | YES                        | NO                                       | YES                            | YES                       | -912.74               | 1835.47                 |\n","| ARIMA(0,1,1)(2,1,0) | YES                        | YES                                      | YES                            | NO                        | EXCLUDED            | EXCLUDED              |\n","| ARIMA(2,1,1)(2,1,0) | NO                         | EXCLUDED                                 | EXCLUDED                       | EXCLUDED                  | EXCLUDED            | EXCLUDED              |\n"]},{"cell_type":"markdown","id":"e4979451","metadata":{"papermill":{"duration":0.0291,"end_time":"2024-06-23T21:34:08.157075","exception":false,"start_time":"2024-06-23T21:34:08.127975","status":"completed"},"tags":[]},"source":["Based on the analysis, ARIMA(2,1,0)(2,1,0) was selected due to its lower AIC value of 1835.47, indicating a better fit compared to the other models. Although ARIMA(2,1,0)(1,0,1) is also a valid model with significant parameters, no significant autocorrelation in the residuals, and normally distributed residuals with p-values above the threshold, the lower AIC value of ARIMA(2,1,0)(2,1,0) supports its selection. Additionally, ARIMA(2,1,0)(2,1,0) has all significant parameters, no significant autocorrelation in the residuals, and the residuals are normally distributed with p-values above the threshold, further supporting its validity and adequacy for the data."]},{"cell_type":"code","execution_count":29,"id":"510a76f2","metadata":{"execution":{"iopub.execute_input":"2024-06-23T21:34:08.217563Z","iopub.status.busy":"2024-06-23T21:34:08.216074Z","iopub.status.idle":"2024-06-23T21:34:08.320023Z","shell.execute_reply":"2024-06-23T21:34:08.318437Z"},"papermill":{"duration":0.137098,"end_time":"2024-06-23T21:34:08.322728","exception":false,"start_time":"2024-06-23T21:34:08.18563","status":"completed"},"tags":[],"vscode":{"languageId":"r"}},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd5wU5f0H8O/MttvrnePuAAFp0hRQUIyCQRG7sVcsGAtRbPlFjQUTNZpYUAFj\nLFFRVFQSUbGhYgAVpSMI0g4Bgett65Tn98fszs5tndtbbnd2P+8/8lpmZ2afWS7cx+/TOMYY\nAQAAAIDx8cluAAAAAAAkBoIdAAAAQJpAsAMAAABIEwh2AAAAAGkCwQ4AAAAgTSDYAQAAAKQJ\nBDsAAACANIFgBwAAAJAmEOwAAAAA0gSCHQAAAECaQLADAAAASBMIdgAAAABpAsEOAAAAIE0g\n2AEAAACkCQQ7AAAAgDSBYAcAAACQJhDsAAAAANIEgh0AAABAmkCwAwAAAEgTCHYAAAAAaQLB\nDgAAACBNINgBAAAApAkEOwAAAIA0gWAHAAAAkCYQ7AAAAADSBIIdAAAAQJpAsAMAAABIEwh2\nAAAAAGkCwQ4AAAAgTSDYAQAAAKQJBDsAAACANIFgBwAAAJAmEOwAAAAA0gSCHQAAAECaQLAD\nAAAASBMIdgAAAABpAsEOAAAAIE0g2AEAAACkCQQ7AAAAgDSBYAepyHnwJU6HM1YeTHZL04b8\nxszrhh5WbjObrVk5Y+/8Idnt6bT2fbO1PxtP7WkLe5osHIjyE8Xz1qKyPr8978YPNzdrr9r0\n9Dj1nCf2tRPRnk9PCbp29q/tQZ/1/olVQed4WJcar/jlw+s5juN5yxv7HR2Of/Pu9RdNGVBV\nbrda84t7jDrxjPvmLGwWI3xkBExsfOONN9544431DkHnJd7Wn/5259VHHt47L8tWWtn3hHOv\nm7dkp/aElh3PKs919/IDnXqohDxR9z9U6M/GETd+G0eroj/+iqsH499DCI8BpB7HgRf1/PSe\n/t2BZLe0ux135Ihhw4YNGzbs8gU7E3jbbfPO1n6xQ274JoE37x7/mzZY+wiDp/0v7GmSd7+e\nHy2TpfSFzY3qVT/OGqu+9fjeNsbYL5+cHHTJCfO2BX3W6cX2oHPccpcazxgT3TWjcq1EVHXS\nCx3u8NilJo4LfZCiI85a0+rV9xUyxtjOBecrF/65pkX